/* eslint-disable jsx-a11y/alt-text */
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Bonjour !<br/> Je suis Anthony Sargento</p>
      </header>
      <img 
        className='waves-up'
        src="/wave.svg"
        />
      <body className="App-body">
        <p>body test test</p>
      </body>
      <img 
        className='waves-down'
        src="/wave(1).svg"
        />
      <footer className="App-footer">

        footer
      </footer>
    </div>
  );
}

export default App;
